import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import CardContact from "./Contactcard";

const ContactList = (props) => {
    const deleteContactHandler = (id) => {
        props.getContactId(id);
    };
    // console.log(props);
//     const contacts = [
//     {
//       'id': 1,
//       'name': 'Pranith',
//       'email': 'prani@gmail.com'
//     },
//     {
//       'id': 2,
//       'name': 'Saravanan',
//       'email': 'saro@gmail.com'
//     },
//     {
//       'id': 1,
//       'name': 'Pavithra',
//       'email': 'pavi@gmail.com'
//     }
//   ]
    const renderedContactList = props.contacts.map((contact) => {
        return <CardContact contact={contact} clickHandler={deleteContactHandler} key={ contact.id} />
});
    return (
        <div className="main" style={{paddingTop:'5rem'}}>
            <h2 >Contact List
                <Link to='/add'>
                    <button className="ui button blue right floated">Add Contact</button>
                </Link>
            </h2>
            <div className="ui celled list">
                {renderedContactList}
            </div>
        </div>
    );
}
export default ContactList;
